import logo from './logo.svg';
import './App.css';
import { Button } from 'bootstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>MediFace</h1>
      </header>
      <div>
        <Button>진료 등록</Button>
      </div>
    </div>
  );
}

export default App;
